import React from "react";
import { Header } from "./components/Header";
import { Section } from "./components/Section";
import { MainDiv } from "./style/style";

function App() {
  return (
    <>
      <MainDiv>
        <Header />
        <Section />
      </MainDiv>
    </>
  );
}

export default App;

